script: |
  super -f text -I q3265.spq | sort > q3265.out

inputs:
  - name: q3265.spq
    data: |
      SELECT DISTINCT - - 35 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q3265.out
    data: |
      35
